import{_ as t,a as e,b as l,c as a,d as r}from"./chunks/cuav_v5_debug_cable.Bzl7voCU.js";import{_ as i,c as d,o as n,ab as h}from"./chunks/framework.CUflZczI.js";const m=JSON.parse('{"title":"Порт відладки SWD","description":"","frontmatter":{},"headers":[],"relativePath":"uk/debug/swd_debug.md","filePath":"uk/debug/swd_debug.md"}'),o={name:"uk/debug/swd_debug.md"},s=h('<h1 id="порт-відладки-swd" tabindex="-1">Порт відладки SWD <a class="header-anchor" href="#порт-відладки-swd" aria-label="Permalink to &quot;Порт відладки SWD&quot;">​</a></h1><p>PX4 працює на мікроконтролерах ARM Cortex-M, які містять спеціалізований апаратний засіб для інтерактивного налагодження через інтерфейс <a href="https://developer.arm.com/documentation/ihi0031/a/The-Serial-Wire-Debug-Port--SW-DP-" target="_blank" rel="noreferrer"><em>Serial Wire Debug (SWD)</em></a> та неінвазивного профілювання та трасування високої пропускної здатності через інтерфейси <a href="https://developer.arm.com/documentation/ddi0403/d/Appendices/Debug-ITM-and-DWT-Packet-Protocol?lang=en" target="_blank" rel="noreferrer"><em>Serial Wire Ouput (SWO)</em></a> та <a href="https://developer.arm.com/documentation/ihi0064/latest/" target="_blank" rel="noreferrer"><em>TRACE</em> pins</a>.</p><p>Інтерфейс відладки SWD дозволяє прямий, низькорівневий, апаратний доступ до процесора мікроконтролера та периферійних пристроїв, тому він не залежить від будь-якого програмного забезпечення на пристрої. Отже, його можна використовувати для налагодження завантажувальних програм та операційних систем, таких як NuttX.</p><h2 id="налагодження-сигналів" tabindex="-1">Налагодження сигналів <a class="header-anchor" href="#налагодження-сигналів" aria-label="Permalink to &quot;Налагодження сигналів&quot;">​</a></h2><p>Чотири сигнали необхідні для відлагодження (в жирному шрифті), а решту лише рекомендується.</p><table><thead><tr><th style="text-align:left;">Назва</th><th style="text-align:left;">Тип</th><th style="text-align:left;">Опис</th></tr></thead><tbody><tr><td style="text-align:left;"><strong>GND</strong></td><td style="text-align:left;">Живлення</td><td style="text-align:left;">Спільний потенціал, спільна основа.</td></tr><tr><td style="text-align:left;"><strong>VREF</strong></td><td style="text-align:left;">Живлення</td><td style="text-align:left;">Цільове довідкове напруга дозволяє засоби налагодження використовувати рівнеміри на сигнали.</td></tr><tr><td style="text-align:left;"><strong>SWDIO</strong></td><td style="text-align:left;">Вхід/вихід</td><td style="text-align:left;">Пін даних для послідовного знавантаження через мережу.</td></tr><tr><td style="text-align:left;"><strong>SWCLK</strong></td><td style="text-align:left;">Вхід</td><td style="text-align:left;">Пін годинника для послідовного знавантаження через мережу.</td></tr><tr><td style="text-align:left;">nRST</td><td style="text-align:left;">Вхід</td><td style="text-align:left;">PIN скидання є необов’язковим (n = активним низьким).</td></tr><tr><td style="text-align:left;">SWO</td><td style="text-align:left;">Вивід</td><td style="text-align:left;">Однопровідний шлейф асинхронних даних з можливістю виведення даних ITM та DWT.</td></tr><tr><td style="text-align:left;">TRACECK</td><td style="text-align:left;">Вивід</td><td style="text-align:left;">Трасування годинника для паралельної шини.</td></tr><tr><td style="text-align:left;">TRACED[0-3]</td><td style="text-align:left;">Вивід</td><td style="text-align:left;">Трасування синхронної шини даних з 1, 2 чи 4 бітами.</td></tr></tbody></table><p>Пін скидання апаратного забезпечення є необов&#39;язковим, оскільки більшість пристроїв також можуть бути скинуті через лінії SWD. Однак швидке скидання пристрою за допомогою кнопки може бути великим плюсом для розробки.</p><p>SWO-пін може випромінювати дані профілювання в реальному часі з наносекундним відмітками часу, тому настійно рекомендується мати доступ до нього для відлагодження.</p><p>Піни TRACE потребують спеціалізованих засобів відлагодження для роботи з високою пропускною здатністю та наступним декодуванням потоку даних. Зазвичай вони недоступні і зазвичай використовуються лише для відлагодження дуже конкретних питань з часом.</p><p><a id="debug-ports"></a></p><h2 id="порти-налагодження-автопілота" tabindex="-1">Порти налагодження автопілота <a class="header-anchor" href="#порти-налагодження-автопілота" aria-label="Permalink to &quot;Порти налагодження автопілота&quot;">​</a></h2><p>Контролери польоту зазвичай надають один засіб налагодження, який використовує як інтерфейс <a href="#debug-signals">SWD</a>, так і <a href="./system_console.html">Системну консоль</a>.</p><p><a href="#pixhawk-standard-debug-ports">Стандарти роз&#39;ємів Pixhawk</a> визначають порт, який повинен бути використаний в кожній версії FMU. Однак є ще багато плат, які використовують різні роз&#39;єми або конектори, тому ми рекомендуємо вам перевірити <a href="./../flight_controller/">документацію для вашого автопілота</a>, щоб підтвердити розташування порту та роз&#39;єму.</p><p>Місцезнаходження порту налагодження та роз&#39;єми для підмножини автопілотів зв&#39;язані нижче:</p><p><a id="port-information"></a></p><table><thead><tr><th style="text-align:left;">Автопілот</th><th style="text-align:left;">Відладочний порт</th></tr></thead><tbody><tr><td style="text-align:left;">Holybro Pixhawk 6X-RT (FMUv6X-RT)</td><td style="text-align:left;"><a href="#pixhawk-debug-full">Порти відладки Pixhawk Full</a></td></tr><tr><td style="text-align:left;">Holybro Pixhawk 6X (FMUv6x)</td><td style="text-align:left;"><a href="#pixhawk-debug-full">Порти відладки Pixhawk Full</a></td></tr><tr><td style="text-align:left;">Holybro Pixhawk 5X (FMUv5x)</td><td style="text-align:left;"><a href="#pixhawk-debug-full">Порти відладки Pixhawk Full</a></td></tr><tr><td style="text-align:left;"><a href="./../flight_controller/durandal.html#debug-port">Holybro Durandal</a></td><td style="text-align:left;"><a href="#pixhawk-debug-mini">Pixhawk Debug Mini</a></td></tr><tr><td style="text-align:left;"><a href="./../flight_controller/kakutef7.html#debug-port">Holybro Kakute F7</a></td><td style="text-align:left;">Паяльні майданчики</td></tr><tr><td style="text-align:left;"><a href="./../flight_controller/pixhawk4_mini.html#debug-port">Holybro Pixhawk 4 Mini</a> (FMUv5)</td><td style="text-align:left;"><a href="#pixhawk-debug-mini">Pixhawk Debug Mini</a></td></tr><tr><td style="text-align:left;"><a href="./../flight_controller/pixhawk4.html#debug_port">Holybro Pixhawk 4</a> (FMUv5)</td><td style="text-align:left;"><a href="#pixhawk-debug-mini">Pixhawk Debug Mini</a></td></tr><tr><td style="text-align:left;"><a href="./../flight_controller/pixhawk3_pro.html#debug-port">Drotek Pixhawk 3 Pro</a> (FMU-v4pro)</td><td style="text-align:left;"><a href="#pixhawk-debug-mini">Pixhawk Debug Mini</a></td></tr><tr><td style="text-align:left;"><a href="./../flight_controller/cuav_v5_plus.html#debug-port">CUAV V5+</a></td><td style="text-align:left;">6-pin JST GH<br>Digikey: <a href="https://www.digikey.com/products/en?keywords=455-1582-1-ND" target="_blank" rel="noreferrer">BM06B-GHS-TBT(LF)(SN)(N)</a> (вертикальний монтаж), <a href="https://www.digikey.com/products/en?keywords=455-1568-1-ND" target="_blank" rel="noreferrer">SM06B-GHS-TBT(LF)(SN)(N)</a> (бічний монтаж)</td></tr><tr><td style="text-align:left;"><a href="./../flight_controller/cuav_v5_nano.html#debug_port">CUAV V5nano</a></td><td style="text-align:left;">6-pin JST GH<br>Digikey: <a href="https://www.digikey.com/products/en?keywords=455-1582-1-ND" target="_blank" rel="noreferrer">BM06B-GHS-TBT(LF)(SN)(N)</a> (вертикальний монтаж), <a href="https://www.digikey.com/products/en?keywords=455-1568-1-ND" target="_blank" rel="noreferrer">SM06B-GHS-TBT(LF)(SN)(N)</a> (бічний монтаж)</td></tr><tr><td style="text-align:left;"><a href="./../flight_controller/pixhawk.html#swd-port">3DR Pixhawk</a></td><td style="text-align:left;">Роз&#39;єм JTAG ARM на 10 контактів (також використовується для плат FMUv2, включаючи: <em>mRo Pixhawk</em>, <em>HobbyKing HKPilot32</em>).</td></tr></tbody></table><p><a id="pixhawk-standard-debug-ports"></a></p><h2 id="стандарт-роз-ємів-pixhawk-debug-портів" tabindex="-1">Стандарт роз&#39;ємів Pixhawk Debug Портів <a class="header-anchor" href="#стандарт-роз-ємів-pixhawk-debug-портів" aria-label="Permalink to &quot;Стандарт роз&#39;ємів Pixhawk Debug Портів&quot;">​</a></h2><p>Проект Pixhawk визначив стандартну схему виводів та тип роз&#39;єму для різних випусків Pixhawk FMU:</p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Перевірте свою <a href="#port-information">конкретну дошку</a>, щоб підтвердити використаний порт.</p></div><table><thead><tr><th style="text-align:left;">Версія FMU</th><th style="text-align:left;">Версія Pixhawk</th><th style="text-align:left;">Відладочний порт</th></tr></thead><tbody><tr><td style="text-align:left;">FMUv2</td><td style="text-align:left;"><a href="./../flight_controller/pixhawk.html#swd-port">Pixhawk / Pixhawk 1</a></td><td style="text-align:left;">10 pin ARM Debug</td></tr><tr><td style="text-align:left;">FMUv3</td><td style="text-align:left;">Pixhawk 2</td><td style="text-align:left;">6 pin SUR Debug</td></tr><tr><td style="text-align:left;">FMUv4</td><td style="text-align:left;">Pixhawk 3</td><td style="text-align:left;"><a href="#pixhawk-debug-mini">Pixhawk Debug Mini</a></td></tr><tr><td style="text-align:left;">FMUv5</td><td style="text-align:left;">Pixhawk 4 FMUv5</td><td style="text-align:left;"><a href="#pixhawk-debug-mini">Pixhawk Debug Mini</a></td></tr><tr><td style="text-align:left;">FMUv5X</td><td style="text-align:left;">Pixhawk 5X</td><td style="text-align:left;"><a href="#pixhawk-debug-full">Pixhawk Debug Full</a></td></tr><tr><td style="text-align:left;">FMUv6</td><td style="text-align:left;">Pixhawk 6</td><td style="text-align:left;"><a href="#pixhawk-debug-full">Pixhawk Debug Full</a></td></tr><tr><td style="text-align:left;">FMUv6X</td><td style="text-align:left;">Pixhawk 6X</td><td style="text-align:left;"><a href="#pixhawk-debug-full">Pixhawk Debug Full</a></td></tr><tr><td style="text-align:left;">FMUv6X-RT</td><td style="text-align:left;">Pixhawk 6X-RT</td><td style="text-align:left;"><a href="#pixhawk-debug-full">Pixhawk Debug Full</a></td></tr></tbody></table><div class="info custom-block"><p class="custom-block-title">INFO</p><p>Єдині FMU та версії Pixhawk (тільки) сумісні після FMUv5X.</p></div><h3 id="pixhawk-debug-mini" tabindex="-1">Pixhawk Debug Mini <a class="header-anchor" href="#pixhawk-debug-mini" aria-label="Permalink to &quot;Pixhawk Debug Mini&quot;">​</a></h3><p><a href="https://github.com/pixhawk/Pixhawk-Standards/blob/master/DS-009%20Pixhawk%20Connector%20Standard.pdf" target="_blank" rel="noreferrer">Стандарт роз&#39;ємів Pixhawk</a> визначає <em>Pixhawk Debug Mini</em>, <em>6-контактний роз&#39;єм SH Debug Port</em>, який надає доступ до обох контактів SWD та <a href="./system_console.html">System Console</a>.</p><p>Це використовується в FMUv4 та FMUv5.</p><p>Схема виводів показана нижче (виводи, необхідні для налагодження, виділені жирним шрифтом):</p><table><thead><tr><th style="text-align:right;">Пін</th><th style="text-align:left;">Сигнал</th></tr></thead><tbody><tr><td style="text-align:right;">1</td><td style="text-align:left;"><strong>VREF</strong></td></tr><tr><td style="text-align:right;">2</td><td style="text-align:left;">Console TX</td></tr><tr><td style="text-align:right;">3</td><td style="text-align:left;">Console RX</td></tr><tr><td style="text-align:right;">4</td><td style="text-align:left;"><strong>SWDIO</strong></td></tr><tr><td style="text-align:right;">5</td><td style="text-align:left;"><strong>SWDCLK</strong></td></tr><tr><td style="text-align:right;">6</td><td style="text-align:left;"><strong>GND</strong></td></tr></tbody></table><p>Визначення порту налагодження містить наступні припояні пластины (на платі поряд із роз&#39;ємом):</p><table><thead><tr><th style="text-align:right;">Pad</th><th style="text-align:left;">Signal</th><th style="text-align:left;">Voltage</th></tr></thead><tbody><tr><td style="text-align:right;">1</td><td style="text-align:left;">nRST</td><td style="text-align:left;">+3.3V</td></tr><tr><td style="text-align:right;">2</td><td style="text-align:left;">GPIO1</td><td style="text-align:left;">+3.3V</td></tr><tr><td style="text-align:right;">3</td><td style="text-align:left;">GPIO2</td><td style="text-align:left;">+3.3V</td></tr></tbody></table><p>Роз&#39;єм - <em>6-pin JST SH</em> - номер Digikey: <a href="https://www.digikey.com/products/en?keywords=455-2875-1-ND" target="_blank" rel="noreferrer">BM06B-SRSS-TBT(LF)(SN)</a> (вертикальний монтаж), <a href="https://www.digikey.com/products/en?keywords=455-1806-1-ND" target="_blank" rel="noreferrer">SM06B-SRSS-TBT(LF)(SN)</a> (бічний монтаж).</p><p>Ви можете підключитися до порту налагодження за допомогою <a href="https://www.digikey.com/products/en?keywords=A06SR06SR30K152A" target="_blank" rel="noreferrer">кабелю, подібного до цього</a>.</p><p><img src="'+t+'" alt="6-pin JST SH Cable"></p><h3 id="порти-відладки-pixhawk-full" tabindex="-1">Порти відладки Pixhawk Full <a class="header-anchor" href="#порти-відладки-pixhawk-full" aria-label="Permalink to &quot;Порти відладки Pixhawk Full&quot;">​</a></h3><p><a href="https://github.com/pixhawk/Pixhawk-Standards/blob/master/DS-009%20Pixhawk%20Connector%20Standard.pdf" target="_blank" rel="noreferrer">Стандарт роз&#39;ємів Pixhawk</a> визначає <em>Pixhawk Debug Full</em>, <em>10-контактний роз&#39;єм SH Debug Port</em>, який надає доступ до обох контактів SWD та <a href="./system_console.html">System Console</a>. Це в основному переміщує паяльні подушки з боку <a href="#pixhawk-debug-mini">Pixhawk Debug Mini</a> в роз&#39;єм, а також додає контакт SWO.</p><p>Цей порт вказаний для використання в FMUv5x, FMUv6, FMUv6x.</p><p>Схема виводів показана нижче (виводи, необхідні для налагодження, виділені жирним шрифтом):</p><table><thead><tr><th style="text-align:right;">Пін</th><th style="text-align:left;">Сигнал</th></tr></thead><tbody><tr><td style="text-align:right;">1</td><td style="text-align:left;"><strong>VREF</strong></td></tr><tr><td style="text-align:right;">2</td><td style="text-align:left;">Console TX</td></tr><tr><td style="text-align:right;">3</td><td style="text-align:left;">Console RX</td></tr><tr><td style="text-align:right;">4</td><td style="text-align:left;"><strong>SWDIO</strong></td></tr><tr><td style="text-align:right;">5</td><td style="text-align:left;"><strong>SWDCLK</strong></td></tr><tr><td style="text-align:right;">6</td><td style="text-align:left;">SWO</td></tr><tr><td style="text-align:right;">7</td><td style="text-align:left;">GPIO1</td></tr><tr><td style="text-align:right;">8</td><td style="text-align:left;">GPIO2</td></tr><tr><td style="text-align:right;">9</td><td style="text-align:left;">nRST</td></tr><tr><td style="text-align:right;">10</td><td style="text-align:left;"><strong>GND</strong></td></tr></tbody></table><p>Піни GPIO1/2 є вільними пінами, які можуть бути використані для генерації сигналів у програмному забезпеченні для аналізу часу з логічним аналізатором.</p><p>Роз&#39;єм - <em>10-pin JST SH</em> - номер Digikey: <a href="https://www.digikey.com/products/en?keywords=455-1796-2-ND" target="_blank" rel="noreferrer">BM10B-SRSS-TB(LF)(SN)</a> (вертикальний монтаж) або <a href="https://www.digikey.com/products/en?keywords=455-1810-2-ND" target="_blank" rel="noreferrer">SM10B-SRSS-TB(LF)(SN)</a> (бічний монтаж).</p><p>Ви можете підключитися до порту налагодження за допомогою <a href="https://www.digikey.com/products/en?keywords=A10SR10SR30K203A" target="_blank" rel="noreferrer">кабелю, подібного до цього</a>.</p><p><img src="'+e+'" alt="10-pin JST SH Cable"></p><p><a id="debug-probes"></a></p><h2 id="зонди-налагодження-для-апаратного-забезпечення-px4" tabindex="-1">Зонди налагодження для апаратного забезпечення PX4 <a class="header-anchor" href="#зонди-налагодження-для-апаратного-забезпечення-px4" aria-label="Permalink to &quot;Зонди налагодження для апаратного забезпечення PX4&quot;">​</a></h2><p>Контролери польоту зазвичай надають <a href="#autopilot-debug-ports">один засіб налагодження</a>, який використовує як інтерфейс <a href="#debug-signals">SWD</a>, так і <a href="./system_console.html">Системну консоль</a>.</p><p>Є кілька зондів відлагодження, які були перевірені та підтримуються для підключення до одного або обох цих інтерфейсів:</p><ul><li><a href="./../debug/probe_jlink.html">SEGGER J-Link</a>: комерційний зонд, без вбудованої послідовної консолі, потребує адаптера.</li><li><a href="./../debug/probe_bmp.html">Чорна магія зондування</a>: інтегрований сервер GDB та послідовна консоль, потребує адаптер.</li><li><a href="./../debug/probe_stlink.html">STLink</a>: найкраща вартість, інтегрована послідовна консоль, адаптер повинен бути паяним.</li><li><a href="./../debug/probe_mculink.html">MCU-Link</a>: найкраща вартість, інтегрована послідовна консоль, потребує адаптер.</li></ul><p>Адаптер для підключення до роз&#39;єму відладки може поставлятися разом із вашим контролером польоту або відлагоджувальним зондом. Інші варіанти наведено нижче.</p><h2 id="адаптери-для-відлагоджування" tabindex="-1">Адаптери для відлагоджування <a class="header-anchor" href="#адаптери-для-відлагоджування" aria-label="Permalink to &quot;Адаптери для відлагоджування&quot;">​</a></h2><h3 id="адаптер-відлагодження-holybro-pixhawk" tabindex="-1">Адаптер відлагодження Holybro Pixhawk <a class="header-anchor" href="#адаптер-відлагодження-holybro-pixhawk" aria-label="Permalink to &quot;Адаптер відлагодження Holybro Pixhawk&quot;">​</a></h3><p><a href="https://holybro.com/products/pixhawk-debug-adapter" target="_blank" rel="noreferrer">Адаптер для відлагодження Holybro Pixhawk</a> <em>високо рекомендований</em> при відлагодженні контролерів, які використовують один із стандартних роз&#39;ємів для відлагодження Pixhawk.</p><p>Це найлегший спосіб підключення:</p><ul><li>Контролери польоту, які використовують або <a href="#pixhawk-debug-full">Повний відлагоджувальний порт Pixhawk</a> (10-контактний SH), або <a href="#pixhawk-debug-mini">Міні відлагоджувальний порт Pixhawk</a> (6-контактний SH).</li><li>SWD відлагоджувальні зонди, які підтримують стандартний інтерфейс ARM з 10-контактною підтримкою, що використовується <a href="./../debug/probe_jlink.html">Segger JLink EDU mini</a> або 20-контактний, сумісний з Segger JLink або STLink.</li></ul><p><img src="'+l+'" alt="Holybro Pixhawk Debug Adapter"></p><h3 id="адаптер-відлагодження-cuav-c-adb-pixhawk" tabindex="-1">Адаптер відлагодження CUAV C-ADB Pixhawk <a class="header-anchor" href="#адаптер-відлагодження-cuav-c-adb-pixhawk" aria-label="Permalink to &quot;Адаптер відлагодження CUAV C-ADB Pixhawk&quot;">​</a></h3><p><a href="https://store.cuav.net/shop/cuav-c-adb/" target="_blank" rel="noreferrer">CUAV C-ADB Додатковий Адаптер Відлагодження Політного Контролера Pixhawk</a> поставляється з <a href="./../debug/probe_stlink.html">STLinkv3-MINIE Відлагоджувальною Сондою</a>.</p><p>Це має порти для підключення до <a href="#pixhawk-debug-full">Pixhawk Debug Full</a> (10-контактний SH) та стандартного інтерфейсу CUAV DSU (але не для <a href="./../debug/swd_debug.html#pixhawk-debug-mini">Pixhawk Debug Mini</a> (6-контактний SH)).</p><p>Роз&#39;єм M2 на перехіднику має 14 контактів CN4 STDC14 (див. <a href="https://www.st.com/resource/en/user_manual/um2910-stlinkv3minie-debuggerprogrammer-tiny-probe-for-stm32-microcontrollers-stmicroelectronics.pdf" target="_blank" rel="noreferrer">Посібник користувача STLinkv3-MINIE</a> для отримання додаткової інформації). Кабель, який використовується для підключення M2 та STLinkv3-MINIE, постачається з адаптером.</p><p><img src="'+a+'" alt="CUAV C-ADB adaptor connected to the STLinkv3-MINIE"></p><h3 id="адаптери-для-відлагоджування-1" tabindex="-1">Адаптери для відлагоджування <a class="header-anchor" href="#адаптери-для-відлагоджування-1" aria-label="Permalink to &quot;Адаптери для відлагоджування&quot;">​</a></h3><p>Деякі SWD <a href="#debug-probes">програмні зонди</a> поставляються з адаптерами / кабелями для підключення до загальних портів відладки Pixhawk <a href="#debug-ports">портів відладки</a>. Зонди, про які відомо, що поставляються з роз&#39;ємами, перераховані нижче:</p><ul><li><a href="./../debug/probe_bmp.html#dronecode-probe">Датчик DroneCode</a>: поставляється з кабелем з&#39;єднувача для підключення до <a href="#pixhawk-debug-mini">Pixhawk Debug Mini</a></li></ul><h3 id="адаптери-специфічні-для-плати" tabindex="-1">Адаптери, специфічні для плати <a class="header-anchor" href="#адаптери-специфічні-для-плати" aria-label="Permalink to &quot;Адаптери, специфічні для плати&quot;">​</a></h3><p>Деякі виробники надають кабелі для зручного підключення інтерфейсу SWD та <a href="./../debug/system_console.html">Консолі системи</a>.</p><ul><li><a href="./../flight_controller/cuav_v5_nano.html#debug_port">CUAV V5nano</a> та <a href="./../flight_controller/cuav_v5_plus.html#debug-port">CUAV V5+</a> включають у себе цей кабель для налагодження:</li></ul><p><img src="'+r+'" alt="6-pin JST SH Cable"></p><h3 id="користувацькі-кабелі" tabindex="-1">Користувацькі кабелі <a class="header-anchor" href="#користувацькі-кабелі" aria-label="Permalink to &quot;Користувацькі кабелі&quot;">​</a></h3><p>Ви також можете створити власні кабелі для підключення до різних плат або зондів:</p><ul><li>Підключіть піни <code>SWDIO</code>, <code>SWCLK</code> та <code>GND</code> на зонді для налагодження до відповідних пінів на порту для налагодження.</li><li>Підключіть контакт VREF, якщо його підтримує засіб відлагодження.</li><li>Підключіть залишкові контакти, якщо вони є.</li></ul><p>Дивіться <a href="./probe_stlink.html">STLinkv3-MINIE</a> для керівництва з тим, як припаяти власний кабель.</p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Де це можливо, ми настійно рекомендуємо створювати або отримувати адаптерну плату, аніж користуватися власноруч виготовленими кабелями для підключення до SWD/JTAG відлагоджувачів та комп&#39;ютерів. Це зменшує ризик неправильного підключення проводів, що призводить до проблем з налагодженням, і має перевагу в тому, що адаптери зазвичай надають спільний інтерфейс для підключення до кількох популярних плат керування польотом.</p></div>',70),g=[s];function x(p,f,b,u,k,y){return n(),d("div",null,g)}const S=i(o,[["render",x]]);export{m as __pageData,S as default};
